import { useEffect, useState } from "react"
import { signOut,getAuth } from "firebase/auth";
import { initializeApp } from "firebase/app";
import { Link, useNavigate } from "react-router-dom";
import axios from "axios";
// import "./commerce.css"



function Free() {
  const [data, setData] = useState([])
  const [value,setValue]=useState("")
  const [img,setImg]=useState("")
  const [name,setName]=useState("")
  const [content,setContent]=useState("")
  const [price,setPrice]=useState("")

  const senddata=(a)=>{
    a.preventDefault()
    let data={img,name,content,price}
        fetch("http://localhost:3006/cart-data",{
          method:"POST",
          headers:{"Content-type":"application/json"},
          body:JSON.stringify(data)
        })
  }
  
  useEffect(() => {
    fetch(" http://localhost:3006/e-commerce")
      .then((res) => {
        return res.json()
      })
      .then((resp) => {
        setData(resp)
      })
  }, [])

  const search=async(kk)=>{
    kk.preventDefault()
    return await axios.get(`http://localhost:3006/e-commerce?q=${value}`)
    .then((g)=>{
      setData(g.data)
    })
    .catch((err)=>{
      console.log(err)

    })
  }

   const change=(s)=>{
    setValue(s.target.value)
  }

  const navigate=useNavigate()
  const firebaseConfig = {
      apiKey: "AIzaSyDZDYClrk3wX0zQARqtQy3r7DaFYuSjleo",
      authDomain: "karthik-30af1.firebaseapp.com",
      projectId: "karthik-30af1",
      storageBucket: "karthik-30af1.appspot.com",
      messagingSenderId: "390068929098",
      appId: "1:390068929098:web:b515e36120e6404d905cb3",
      measurementId: "G-X1CEJRWMMH"
    };

   initializeApp(firebaseConfig);
  const auth = getAuth()
  
  const submitData=(event)=>{
      event.preventDefault()

     
      signOut(auth)

      .then(()=>{
          alert("logged out Successfully")
          navigate("/login")
         
      })
      .catch((err)=>{
          alert("Error", err)
      })

    }
  return (
    <div>
      <nav className="navbar bg-dark border-bottom border-body" data-bs-theme="dark">
        <div className="container-fluid">
          <a className="navbar-brand"><b style={{color:"rgb(161, 255, 66)"}}>DOG</b><i className="fa-solid fa-dog fa-bounce fa-xl" style={{color: "#df9834"}}/><sub style={{color:"rgb(222, 18, 175)"}}>KART</sub></a>
          <a className="navbar-brand"><i className="fa-solid fa-house fa-beat fa-xl" style={{color: "#26c0b5"}}/></a>
          <a className="navbar-brand">
          <Link to={"/cart"}><i className="fa-solid fa-cart-shopping fa-shake fa-xl" style={{color: "#26c0b5"}}/></Link>
          </a>

          <form className="d-flex" role="search" onSubmit={search}>
            <input className="form-control me-2" type="search" placeholder="Search" value={value} onChange={change} aria-label="Search" />
            <button className="btn btn-outline-success" type="submit">Search</button>
          </form>
          <button className="btn btn-outline-success" onClick={submitData} type="text">Log-Out</button>
        </div>
      </nav>

       <h1 style={{textAlign:"center"}}><b>DOG's & CAT's FOR SALES</b></h1>
      <div className="row my-2">
        {data.map((item)=>(

          <div className= "shadow col-sm-3 mb-3" >
            <div className="card h-100">

              <div className="card-body">
                <img src={item.img} value={img} onChange={e=>setImg(e.target.value)} className="mb-2" alt="kk" height="200px" width="100%" />
                <h5 className="card-title" value={name} onChange={e=>setName(e.target.value)} >{item.name}</h5>
                <p className="card-text" value={content} onChange={e=>setContent(e.target.value)} >{item.content}</p>
                <h4 value={price} onChange={e=>setPrice(e.target.value)} >Rs.{item.price}$</h4>
                <a href="#" className="btn btn-primary" onClick={senddata}>ADD CART(+)</a>
              </div>

            </div>
          </div>

        ))}
      </div>

      <div style={{display:"flex",justifyContent:"space-evenly",backgroundColor:"rgb(241, 240, 240)", padding:"40px"}}>

  <div className="">
    <div className="card-body">
      <h5 className="card-title">PAGES</h5>
      <p className="card-text">About us</p>
      <p className="card-text">Our Experince</p>
      <p className="card-text">Dog's & Cat's</p>
      <p className="card-text">Shop</p>
    </div>
  </div>
  <div className="">
    <div className="card-body">
      <h5 className="card-title">Legal And Help</h5>
      <p className="card-text">FAQs</p>
      <p className="card-text">Terms of Use</p>
      <p className="card-text">Privacy Policy</p>
    </div>
  </div>
  <div className="">
    <div className="card-body">
      <h5 className="card-title">Contact us</h5>
      <p className="card-text"><i class="fa-solid fa-location-dot" style={{color: "#439924"}}/> Address</p>
      <p className="card-text"><i class="fa-solid fa-phone" style={{color: "#439924"}}/> Phone Number</p>
      <p className="card-text"><i class="fa-solid fa-envelope" style={{color: "#439924"}}/> Mail Id</p>
    </div>
  </div>
  <div className="">
    <div className="card-body">
      <h2 className="card-title">Social Link</h2>
      <p className="card-text">About us</p>
    </div>
    </div>
</div>



    </div>
  )
}
export default Free;
